import React, {Component, Fragment} from 'react';
import Topbanner from '../component/home_component/topBanner';
import Increment from '../component/counter_component/counter';

class HomePage extends Component{

   render(){
        return (
            <Fragment>
                <Topbanner />
                <h1 className='homeTitle'>This is My Counter</h1>
                <Increment />
            </Fragment>
)
}
}
export default HomePage;
